export const yearValidation = (val) => {
    if (isNaN(val) || val.length != 4 || val < 0) {
        return {
            status: 'error',
            msg: 'year is not valid'
        }
    }
    return { status: 'ok' }
}

export const runtimeValidation = (val) => {
    if (isNaN(val) || val < 0) {
        return {
            status: 'error',
            msg: 'year is not valid'
        }
    }
    return { status: 'ok' }
}
